import React from 'react';
import Email from './images/envelope-open.svg'; 
import Telephone from './images/telephone-inbound.svg'; 
import Likes from './images/suit-heart.svg'; 

const NavBar = () => {
    function contactMethods() {
        return (
            <div style={{ display: 'flex', justifyContent: 'space-between', backgroundColor: '#333333', color: 'white' }}>
                <div>
                    <span><img src={Email}  />SALES@RENTAWARE.COM</span>
                    <span>  |  </span>
                    <span>[logo]+65 8936 3356</span>
                </div>

                <div>
                    <span>[logo]My Wishlist</span>
                </div>
            </div>
        )
    }

    function mainNavbar() {
        return (
            <div>

            </div>
        )
    }

    return (
        <div>
            {contactMethods()}
            {mainNavbar()}
        </div>
    )
}

export default NavBar;
